getting-started/how-it-works.html.body:
How Videogular works
Videogular relies heavily on HTML5 standards allowing you to create your own video player just by adding some tags and attributes to your HTML code.
Before you create your first video player first you need to understand the main elements of Videogular.

VgPlayer: Component where you will put all your components, directives and custom elements. It usually will be your root tag.
VgMedia: Directive that will expose properties and events to VgAPI. Usually added to a video or audio tag.
VgAPI: API exposed by VgPlayer that allows you to control the player from your own Components.

For example, this is the most basic video player that you can create with Videogular:






Obviously, this is too basic and probably we want to add some custom controls to skin it properly.
Adding more components
Let's go to add an overlay play and a custom control bar.




























This is great! We can add some Videogular components to have a nice UI for our video player. Notice for example that we have two VgScrubBar components. that's because it's a smart component that can work inside and outside VgControls.
The VgScrubBar inside controls has a pointer-events: none; to avoid clicks on it but it's necessary to create some space between components. Of course, if you like, you can remove it and create your own div with a class and it will do the job too. That's the good thing about using custom elements!
You can also disable slider events in the VgScrubBar using the vgSlider attribute (true is default):





Optionally, a circle can be shown in VgScrubBarCurrentTime using the same vgSlider attribute (false is default):





One of the most important things that you need to understand is that all components are not going to work if you don't add a vgMedia directive to the video tag. So remember to add at least one vgMedia on each player.
Now you can create your TypeScript file and compile/bundle with your favourite setup.
// Module
import {NgModule} from '@angular/core';
import {BrowserModule} from '@angular/platform-browser';
import {VgCoreModule} from 'videogular2/core';
import {VgControlsModule} from 'videogular2/controls';
import {VgOverlayPlayModule} from 'videogular2/overlay-play';
import {VgBufferingModule} from 'videogular2/buffering';
import {SingleMediaPlayer} from './single-media-player';

@NgModule({
    imports: [
        BrowserModule,
        VgCoreModule,
        VgControlsModule,
        VgOverlayPlayModule,
        VgBufferingModule
    ],
    declarations: [SingleMediaPlayer],
    bootstrap: [SingleMediaPlayer]
})
export class AppModule {
}

// Media Player Component
import {Component} from "@angular/core";

@Component({
    selector: 'single-media-player',
    templateUrl: 'src/single-media-player.html'
})
export class SingleMediaPlayer {}

Now that we know how to create a simple player let's see in the next page how to create a more complex player.

getting-started/using-the-api.html.body:
Using the API
Videogular's API is the service that will allow you to control the media objects and listen to any change on them. It's not mandatory to use the API but if you need to control externally the medias or you want to listen to changes you need use it. 
To start using the API first you need to grab it from the player. To do that listen for the event onPlayerReady that will get you the API:






























Now on your Component get the API:
import {Component} from '@angular/core';
import {VgAPI} from 'videogular2/core';

@Component({
    selector: 'bound-player',
    templateUrl: 'src/bound-player.html'
})
export class BoundPlayer {
    preload:string = 'auto';
    api:VgAPI;

    constructor() {}

    onPlayerReady(api:VgAPI) {
        this.api = api;
    }
}

Now that you have the API you can listen to changes and perform actions:
onPlayerReady(api:VgAPI) {
    this.api = api;

    this.api.getDefaultMedia().subscriptions.ended.subscribe(
        () => {
            // Set the video to the beginning
            this.api.getDefaultMedia().currentTime = 0;
        }
    );
}

You have a lot of events to listen:

canPlay: Sent when enough data is available that the media can be played, at least for a couple of frames. This corresponds to the HAVE_ENOUGH_DATA readyState.
canPlayThrough: Sent when the ready state changes to CAN_PLAY_THROUGH, indicating that the entire media can be played without interruption, assuming the download rate remains at least at the current level. It will also be fired when playback is toggled between paused and playing. Note: Manually setting the currentTime will eventually fire a canplaythrough event in firefox. Other browsers might not fire this event.
loadedMetadata: The media's metadata has finished loading; all attributes now contain as much useful information as they're going to.
waiting: Sent when the requested operation (such as playback) is delayed pending the completion of another operation (such as a seek).
progress: Sent periodically to inform interested parties of progress downloading the media. Information about the current amount of the media that has been downloaded is available in the media element's buffered attribute. 
seeking: Sent when a seek operation begins.
seeked: Sent when a seek operation completes.
ended: Sent when playback completes.
playing: Sent when the media begins to play (either for the first time, after having been paused, or after ending and then restarting). 
play: Sent when playback of the media starts after having been paused; that is, when playback is resumed after a prior pause event. 
pause: Sent when playback is paused. 
timeUpdate: he time indicated by the element's currentTime` attribute has changed. 
volumeChange: Sent when the audio volume changes (both when the volume is set and when the muted attribute is changed). 
error: Sent when an error occurs.  The element's error attribute contains more information. 
startAds: Sent when an advertisement started. This event will only be triggered if you have the Videogular Google IMA in your media player. 
endAds: Sent when an advertisement completes. This event will only be triggered if you have the Videogular Google IMA in your media player. 

Event information extracted from MDN: https://developer.mozilla.org/en-US/docs/Web/Guide/Events/Media_events
